$(function(){$('[data-plugin="googlemap"]').each(function(){var n=$(this),t=n.attr("id"),i=n.data("center"),r=n.data("locations");GoogleMaps.Configure({Height:800,Zoom:16,ShowInfoBox:!0});GoogleMaps.Init(t,GoogleMapsUtils.ParseLocations(r),GoogleMapsUtils.ParseCenter(i))});$("#HomeContacts .btn-open").click(function(n){n.preventDefault();$("#Form_sidebar").toggleClass("open");$("#Header").toggleClass("headerOrange");$("#Header .logo img").attr("src","/Content/imgs/logos/logo-header.svg");$("#HomeContacts .btn-open i").toggleClass("icon-arrow-right-2").addClass("icon-arrow-left-2")});$("#Form_sidebar .btn-Fclose").click(function(n){n.preventDefault();$("#Form_sidebar").removeClass("open");$("#Header").removeClass("headerOrange");$("#Header .logo img").attr("src","/Content/imgs/logos/logo.svg");$("#HomeContacts .btn-open i").removeClass("icon-arrow-left-2").addClass("icon-arrow-right-2")})});